import Details from './components/Details'
import Exercises from './components/Exercises';
import { Switch, Link, Route } from 'react-router-dom';
import './App.css';


function App() {
  return (
    <div className="App">
      <Switch>
        <Route path="/details/:id" component={Details} />
        <Route path="/" component={Exercises} />
      </Switch>
      <Exercises />
      <Details />
    </div>
  );
}

export default App;
